[Form]
public class BudgetEncumbranceReconciliationSummary extends FormRun
{
    private BudgetEncumbranceSummaryForm budgetEncumbranceSummaryForm;
    private DimensionHierarchy dimensionHierarchy;

    private const str GeneralLedgerBalanceFeatureWhatsNewGuidStr = '{544695dd-6320-4240-b008-e35a07449347}';

    #Dimensions
}

public void init()
{
    // If budget control is disabled or inactive then budget encumbrance reconciliation summary form should not open and throw exception
    if (!BudgetControlConfigurationManager::isBudgetControlEnabledAndConfigured() || !LedgerParameters::find().IsEncumbranceProcessEnabled)
    {
        // Throw error("@Budget:BudgetEncumbranceReconciliationSummaryCannotBeOpened");
        element.lifecycleHelper().exitForm("@Budget:BudgetEncumbranceReconciliationSummaryCannotBeOpened");
    }

    if (this.hasValidSetupForForm())
    {
        super();

        this.loadData();
    }
    else
    {
        element.lifecycleHelper().exitForm("@Budget:BudgetEncumbranceMainAccountMissing");
    }

    if (GeneralLedgerBalanceFeatureRecommendationFlight::instance().isEnabled()
        && !FeatureStateProvider::IsFeatureEnabled(GeneralLedgerBalanceFeature::instance()))
    {
        SystemNotificationsWhatsNewManager::AddWhatsNewWithActionLink(
            GeneralLedgerBalanceFeatureWhatsNewGuidStr,
            "@GeneralLedger:GeneralLedgerBalanceFeature",
            "@GeneralLedger:GeneralLedgerBalanceFeatureSummary",
            ctrlDimensionSet.name(),
            "@GeneralLedger:GeneralLedgerBalanceFeatureLink");
    }
}

private void loadData()
{
    budgetEncumbranceSummaryForm = BudgetEncumbranceSummaryForm::construct(element);

    if (!dimensionHierarchy)
    {
        dimensionHierarchy = DimensionHierarchy::getMainAccountFocus();
    }

    this.showLedgerAccountsByFlag(this.DisplayLedgerAccounts.value());

    this.showVarianceAccountsByFlag(this.DisplayVarianceEntryOnly.value());

    this.setUpDataSourceAndControls();

    this.executeDataSourceQuery();
}

/// <summary>
/// Filter the data on the basis of varinace field in the form.
/// </summary>
/// <param name = "_showVarianceEntriesOnly">If true show only that data which has some total variance else show all.</param>
private void showVarianceAccountsByFlag(boolean _showVarianceEntriesOnly)
{
    if (_showVarianceEntriesOnly)
    {
        str rangeStr = strFmt('(%1 - %2 - %3) != 0',
            fieldStr(BudgetTrialEncumbranceInquirySummaryTmp, TrialBalance),
            fieldStr(BudgetTrialEncumbranceInquirySummaryTmp, Encumbrance),
            fieldStr(BudgetTrialEncumbranceInquirySummaryTmp, PreEncumbrance));

        budgetTrialEncumbranceInquirySummaryTmp_ds.query().dataSourceTable(tableNum(BudgetTrialEncumbranceInquirySummaryTmp))
            .addRange(fieldNum(BudgetTrialEncumbranceInquirySummaryTmp, trialBalance)).value(rangeStr);
    }
    else
    {
        budgetTrialEncumbranceInquirySummaryTmp_ds.query().dataSourceTable(tableNum(BudgetTrialEncumbranceInquirySummaryTmp))
            .clearRange(fieldNum(BudgetTrialEncumbranceInquirySummaryTmp, trialBalance));
    }

}

/// <summary>
/// Filter the data on the basis of balanced field in the form.
/// </summary>
/// <param name = "_showAll">If true then show all transaction else shows only those transaction which are not balanced.</param>
private void showLedgerAccountsByFlag(boolean _showAll)
{
    if (_showAll)
    {
        budgetTrialEncumbranceInquirySummaryTmp_ds.query().dataSourceTable(tableNum(BudgetTrialEncumbranceInquirySummaryTmp))
            .clearRange(fieldNum(BudgetTrialEncumbranceInquirySummaryTmp, isBalanced));
    }
    else
    {
        budgetTrialEncumbranceInquirySummaryTmp_ds.query().dataSourceTable(tableNum(BudgetTrialEncumbranceInquirySummaryTmp))
            .addRange(fieldNum(BudgetTrialEncumbranceInquirySummaryTmp, isBalanced)).value(queryValue(NoYes::No));
    }

}

private void setUpDataSourceAndControls()
{
    Query query = BudgetTrialEncumbranceInquirySummaryTmp_ds.query();

    if (FeatureStateProvider::IsFeatureEnabled(GeneralLedgerBalanceFeature::instance()))
    {
        this.setDataSourceEnabled(query, tableNum(DimensionFocusNameTmp), false);
        this.setDataSourceEnabled(query, tableNum(DimensionAttributeValueCombination), false);

        DimensionAttributeValue01.visible(false);
        DimensionAttributeValue02.visible(false);
        DimensionAttributeValue03.visible(false);
        DimensionAttributeValue04.visible(false);
        DimensionAttributeValue05.visible(false);
        DimensionAttributeValue06.visible(false);
        DimensionAttributeValue07.visible(false);
        DimensionAttributeValue08.visible(false);
        DimensionAttributeValue09.visible(false);
        DimensionAttributeValue10.visible(false);
        DimensionAttributeValue11.visible(false);
        DimensionAttributeValueCombination_DisplayValue.visible(false);
        DimensionFocusNameTmp_FocusValue.visible(false);
    }
    else
    {
        this.setDataSourceEnabled(query, tableNum(GeneralLedgerBalanceDimensionDescriptionsTmp), false);
        this.setDataSourceEnabled(query, tableNum(GeneralLedgerBalanceReportingDimension), false);

        DimensionValue01.visible(false);
        DimensionValue02.visible(false);
        DimensionValue03.visible(false);
        DimensionValue04.visible(false);
        DimensionValue05.visible(false);
        DimensionValue06.visible(false);
        DimensionValue07.visible(false);
        DimensionValue08.visible(false);
        DimensionValue09.visible(false);
        DimensionValue10.visible(false);
        DimensionValue11.visible(false);
        DimensionValue_DisplayValue.visible(false);
        DimensionValue_Description.visible(false);
    }
}

private void setDataSourceEnabled(Query _query, TableId _tableId, boolean _enabled)
{
    QueryBuildDataSource qbds = _query.dataSourceTable(_tableId);

    if (qbds && qbds.enabled() != _enabled)
    {
        qbds.enabled(_enabled);
    }
}

/// <summary>
/// Execute the data source query.
/// </summary>
private void executeDataSourceQuery()
{
    budgetTrialEncumbranceInquirySummaryTmp_ds.executeQuery();

    BudgetEncumbranceInquiryProcessor budgetEncumbranceInquiryProcessor = budgetEncumbranceSummaryForm.getBudgetEncumbranceInquiryProcessor();

    if (budgetEncumbranceInquiryProcessor)
    {
        budgetEncumbranceInquiryProcessor.populateBudgetTrialEncumbranceInquirySummaryTotal(this.DisplayLedgerAccounts.value(), this.DisplayVarianceEntryOnly.value());
    }

    BudgetTrialEncumbranceInquiryGrandTotalTmp_ds.executeQuery();
}

/// <summary>
/// Checks if <C>budgetEncumbranceInquiryMainAccount</C> table has entry or not for the current ledger.
/// </summary>
/// <returns>true if entries are present else false.</returns>
private boolean hasValidSetupForForm()
{
    BudgetEncumbranceInquiryMainAccount budgetEncumbranceInquiryMainAccount;

    select count(RecId) from budgetEncumbranceInquiryMainAccount;

    return budgetEncumbranceInquiryMainAccount.RecId > 0;
}

