void clicked()
{
    if (budgetEncumbranceSummaryForm.isValidParameter())
    {
        budgetEncumbranceSummaryForm.setBalanceDimensionDescriptionsTmp(generalLedgerBalanceDimensionDescriptionsTmp);

        budgetEncumbranceSummaryForm.generateBalanceAmount(
            budgetTrialEncumbranceInquirySummaryTmp,
            budgetAnalysisDimensionSummaryTmp,
            budgetAnalysisDimensionGrandTotalTemp,
            dimensionFocusNameTmp,
            BudgetTrialEncumbranceInquiryGrandTotalTmp);

        element.executeDataSourceQuery();
    }
}

